import logo from './logo.svg';
import './App.css';

const App = () => {
  return (
    <div>
      <div><Header /></div>
      <div className="App">
        <ul> 
          <li>css</li>
          <li>html</li>
          <li>js</li>
          <li>react</li>
        </ul>
      </div>
    </div>
  );
}

const Header = () => {
  return (
    <div className="Header">
       <a href="#">Home</a>
       <a href="#">News Fast</a>
       <a href="#">Massages</a>
    </div>
  );
}

export default App;
